            }
        });
    }

    function loadLocation() {
        return appAjax('Loading...', {
            type: "GET",
            url: `/_api/msdyn_locations(${locationRecordId})?$select=msdyn_branchaddress,msdyn_name`,
            contentType: "application/json"
        });
    }

    loadLocation().done(function (data) {
        initializeLocation(data)
    });

    function initializeLocation({msdyn_name, msdyn_branchaddress}) {
        $('[data-name="main-section"] > tbody').prepend('<tr><td class="clearfix cell"><h4 class="locationNameFieldContent">' + msdyn_name + '</h4><h4 class="locationAddressFieldContent">' + msdyn_branchaddress + '</h4></td></tr>');
