            getContactsAtBank().done(function (data) {
                $('[data-name="bank-rep-selection"]').parent().show();
                showReps(data.value);
            });
        } else {
            $('[data-name="bank-rep-selection"]').parent().hide();
        }
    });

    function getContactsAtBank() {
        return appAjax('Loading...', {
            type: "GET",
            url: `/_api/contacts?$expand=msdynce_Contact_msdyn_Service_msdyn_Service&$filter=_msdynce_bankbranchcode_value%20eq%20${locationRecordId}`,
            contentType: "application/json"
        });
    }

    function showReps(contacts) {
        let contactsWithRequiredSpeciality = surya = contacts.filter(contact => {
            let opt = contact.msdynce_Contact_msdyn_Service_msdyn_Service.some((
                { msdyn_serviceid }) => msdyn_serviceid == $("#msdyn_services").val());
            return opt;
        });

        let allInputs = '';
        contactsWithRequiredSpeciality.forEach((contact, index) => allInputs += `
            <input
                id="representative_${index}" type="radio"
                name="representative"
                data-name="${contact.fullname}"
                value="${contact.contactid}" />
            <label for="representative_${index}">
                <span class="sr-only">Select a Specialist</span>
                ${contact.fullname}
            </label>
            <br />
        `);

        $('[data-name="bank-rep-selection"] > tbody > tr').eq(0).attr("colspan", "1").attr("rowspan", "1")
        $('[data-name="bank-rep-selection"] > tbody > tr').eq(0).html(`
            <td class="clearfix cell picklist-cell">
                <div class="info">
                    <label id="representative_label" class="field-label">
                        Select a Specialist
                    </label>
                    <div class="validators"></div>
                    </div>
                    <div class="control">
                    <span id="representative-list"
                        class="picklist vertical representative" role="presentation">
                        ${allInputs}
                    </span>
                </div>
            </td>
        `
        )

        $('#representative-list input[type="radio"]').change(function() {
            const selectedRadio = $(this).filter(':checked').eq(0);
            $("#msdyn_bankrepcontact_name").val(selectedRadio.attr('data-name'));
            $("#msdyn_bankrepcontact").val(selectedRadio.val());
            $("#msdyn_bankrepcontact_entityname").val("contact");
        });
