    var daysOfYear = [];
    var avSlots = ["8:00 am", "9:00 am", "10:00 am", "11:00 am", "12:00 pm", "1:00 pm", "2:00 pm", "3:00 pm"] ; 
    var unAvailabilityData;
    var rData; 
    var unAvailableSlots = [];
    var itemWidth = "";

    $(document).ready(function() { 
        $(".entitylist").hide();
        var userId = window["Microsoft"].Dynamic365.Portal.User.contactId;
        sessionStorage.setItem("BankRep", userId);
        createDateCards(); 
