    waitForData("tr[data-entity='msdyn_service']", appendIconsToCards, mapServicesToPivots, addSelectedClassToCards, handlePivotClick);
  });
  /* Function to wait for cards to load and specialties data fetch */
  var waitForData = function(selector, callback1, callback2, callback3, callback4) {
    if ($(selector).length > 0 && specialtiesData) {
      callback1();
      callback2();
      callback3(specialtiesData);
      callback4($("#everyday-banking"));
    } else {
      setTimeout(function() {
        waitForData(selector, callback1, callback2, callback3, callback4);
      }, 100);
    }
  };

  var appendIconsToCards = function() {
    var cardSelector = $("tr[data-entity='msdyn_service']");
    Object.keys(cardSelector).forEach(function(card) {
      if (Number(card) >= 0) {
        var alphaNumericServiceName = $(cardSelector[card]).attr("data-name").replace(/[^a-zA-Z0-9]/g, '').toLowerCase();
        var iconsHtml = (
        `<button class="specialty-icon-container" style="border:none;--bs-table-accent-bg: #fff;">
