  /* Map services to their service category */
  var mapServicesToPivots = function() {
    var categorySelector = $("td[data-attribute='msdyn_servicecategory']");
    Object.keys(categorySelector).forEach(function(element) {
      if (Number(element) >= 0) {
        if (!pivotCategories[$(categorySelector[element]).text()]) {
          pivotCategories[$(categorySelector[element]).text()] = [$(categorySelector[element]).parent()];
        } else {
          pivotCategories[$(categorySelector[element]).text()].push($(categorySelector[element]).parent());
        }
      }
    })
