  var renderProfileImage = function(url) {
    return $(".profile-image").attr("src", "data:image/png;base64," + url);
  }
  var encodeImageFileAsURL = function(element) {
    let input = $(element);
    let label = input.val().replace(/\\/g, '/').replace(/.*\//, '');
    let fileNameLabelEl = $(element).parents('.input-group').find('span.form-control');

    if (fileNameLabelEl.length) {
      fileNameLabelEl.text(label);
    }

    var file = element.files[0];
    var reader = new FileReader();
    reader.onloadend = function() {
      encodedImage = reader.result.replace('data:image/png;base64,', '').replace('data:image/jpeg;base64,', '').replace('data:image/gif;base64,','');
    };
    reader.readAsDataURL(file);    
  };
  var uploadProfileImage = function(image) {
    var uploadUrl = '/_api/contacts(' + userId + ')/entityimage';
    webapi.safeAjax({
      type: "PUT",
      url: uploadUrl,
      contentType: "application/json",
      data: JSON.stringify({
        "value": image
      }),
      success: function(res) {
        location.reload(true);
      },
      error: function(error) {
        console.error('Error uploading profile image', error);
      }
    })
  }
  /* Pivot UI logic */
  var handlePivotClick = function(element) {
    pivotState = element.innerHTML || element.text();
    $(".pivot-button").removeClass("selected-pivot-button");
    $(element).addClass("selected-pivot-button");
    updatePivotTiles(pivotState);
  };
  var updatePivotTiles = function(pivotName) {
    var tiles = $("tr[data-entity='msdyn_service']");
    tiles.hide();
    pivotCategories[pivotName].forEach(function(element) {
      $(element[0]).show();
    })
  }
  /* Specialty card select & webapi calls */
  var handleTileClick = function(element) {
    var serviceId = $(element).attr("data-id");
    var alphaNumericServiceName = $(element).attr("data-name").replace(/[^a-zA-Z0-9]/g, '').toLowerCase();
    var checkboxIcon = $("#" + alphaNumericServiceName + "-checkbox-icon");
    var specialtyIcon = $("#" + alphaNumericServiceName + "-specialty-icon");
    if ($(element).hasClass("selected-specialty-card")) {
      deleteSpecialty(serviceId, function() {
        $(checkboxIcon).attr("src", "/unselected.png");
        $(specialtyIcon).attr("src", `/${alphaNumericServiceName}.png`);
        $(element).removeClass("selected-specialty-card");
      });
    } else {
      addSpecialty(serviceId, function() {
        $(checkboxIcon).attr("src", "/selected.png");
        $(specialtyIcon).attr("src", `/${alphaNumericServiceName}-selected.png`);      
        $(element).addClass("selected-specialty-card");
      });
    }
  }
  var addSpecialty = function(serviceId, callback) {
    var testUrl = "/_api/contacts(" + userId + ")/msdynce_Contact_msdyn_Service_msdyn_Service/$ref";
    webapi.safeAjax({
      type: "POST",
      url: testUrl,
      contentType: "application/json",
      data: JSON.stringify({
        "@odata.id": window.location.origin + "/_api/msdyn_services(" + serviceId + ")"
      }),
      success: function(res) {
        callback();
      },
      error: function(error) {
        console.error('Error adding specialty', error);
      }
    })
  };
  var deleteSpecialty = function(serviceId, callback) {
    var deleteUrl = "/_api/contacts(" + userId + ")/msdynce_Contact_msdyn_Service_msdyn_Service/$ref?$id=" + window.location.origin + "/_api/msdyn_services(" + serviceId + ")";
    webapi.safeAjax({
      type: "DELETE",
      url: deleteUrl,
      contentType: "application/json",
      success: function(res) {
        callback();
      },
      error: function(error) {
        console.error('Error removing specialty', error);
      }
    })
  }
  var selectIfUnselected = function(element) {
    if ($(element).hasClass("selected-specialty-card")) {
      return;
    } else {
      handleTileClick(element);
    }
  }
  var handleSelectAll = function() {
    pivotCategories[pivotState].forEach(function(element) {
      selectIfUnselected(element[0]);
    });
  }
