                    return;
                }
                submitSelectedSubCategory.call(this);
                $("input#NextButton.btn.button1").click();
            });
        }

        $(':radio[name="category"]').keydown(function (evt) {
            if (evt.key === " " || evt.key === "Enter") {
                $(this).prop('checked', true);
                preventNextChange = false;
                submitSelectedCategory.call(this, true);
            } else {
                preventNextChange = evt.key !== "Tab";
            }
        });

        $(':radio[name="category"]').click(function (evt) {
            if (preventNextChange) { // this gets called with keyboard arrow navigation
                evt.preventDefault();
                preventNextChange = false;
                return;
            }
            submitSelectedCategory.call(this);
        });

        $(".category-cards-container").focus();
    }
