    var daysOfYear = [];
    var avSlots = ["8:00 am", "9:00 am", "10:00 am", "11:00 am", "12:00 pm", "1:00 pm", "2:00 pm", "3:00 pm"] ; 
    var unAvailabilityData;
    var rData; 
    

    $(document).ready(function() { 
        createDateCards(); 
        getAppointment(); 

        $('.MultiCarousel .MultiCarousel-inner .days-box:nth-child(1)').addClass('current-date');       
        $(".day-button").click(function() {
            $(".calendar-box").removeClass("weekview-calendar-box");
