            $('.MultiCarousel .MultiCarousel-inner .days-box').removeClass('current-date');
            $(".MultiCarousel-inner").css("transform", "translateX(0px)");
            $('.MultiCarousel .MultiCarousel-inner .days-box:nth-child(1)').addClass('current-date');
            $(this).addClass("view-active");
            $(".prev-button").attr("disabled","true");
        });
